/* eslint-disable react/prop-types */
import React from 'react';
import axios from 'axios';

const Posts = ({ posts }) => (
  <div>
    <ul>
      {posts.map(post => (
        <li key={post.id}>{post.login}</li>
      ))}
    </ul>
  </div>
);

export default Posts;
